取り付け簡単！装着面の3Mフィルムを剥がすだけで取り付けできます。純正ミラーウインカーにジャストフィット。製品本体後方と側面の形状を各ミラーごとに最適化し、ウインカー発光時の視認性を確保しました。素材は光沢、強度に優れたABS樹脂を使用しています。 <br>●左右セット ●カラー：メッキ ●両面テープ付 ●材質：ABS<br>※オプション装着車（一部）及び社外品はウインカー形状が違いますので必ず形状をご確認下さい。 <br>対応車種：L275/285S プレオカスタム（H22.4～） 全車対応 <br>　車検対応品<br>ボディパーツ/ドアミラー<tr><td colspan="2">
